#include <gtest/gtest.h>
#include "Brute-Force.h"
#include "Karp-Rabin.h"
#include "Knuth-Morris-Pratt.h"
#include "Finite-Automata.h"

#include <vector>
#include <string>

using namespace std;
// Brute Force Search
TEST(stringSearch, Brute_Force_1)
{
    vector<int> shift = {0, 6, 11, 16, 21};
    vector<int> res = bruteForceSearch("ABCasdABCaaABCddABCddABC", "ABC");
    EXPECT_EQ(shift,res);
}

TEST(stringSearch, Brute_Force_2)
{
    vector<int> shift;
    for (int i(0); i <= 26; i++)
        shift.push_back(i);
    vector<int> res = bruteForceSearch("aaaaaaaaaaaaaaaaaaaaaaaaaaa", "a");
    EXPECT_EQ(shift,res);
}

TEST(stringSearch, Brute_Force_3)
{
    vector<int> shift;
    vector<int> res = bruteForceSearch("ababababababababab", "bb");
    EXPECT_EQ(shift,res);
}

TEST(stringSearch, Brute_Force_4)
{
    vector<int> shift = {3, 17, 29, 42, 47};
    vector<int> res = bruteForceSearch("abbaabbaabbbabaabaabbabbaabbbaabbabbbbbbaaaabbaaabbaaaaaabb", "aabba");
    EXPECT_EQ(shift,res);
}

TEST(stringSearch, Brute_Force_5)
{
    string str = "";
    vector<int> shift = {3662, 4388, 5851, 7155, 7965, 11681, 15022, 20702, 22664, 23836, 24403, 24527, 26307, 34660};
    vector<int> res = bruteForceSearch(str, "acbcaca");
    EXPECT_EQ(shift,res);
}
